import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      div.container
      <header className="App-header">
        <h1>Dictionary</h1>

        <a
          className="btn btn-danger"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
